mapper.select:

select 

from TB_PAY_CHECK_DISREGARD
where DISREGARD_NO = #{DISREGARD_NO,jdbcType=VARCHAR}
  and CHECK_NBR = #{CHECK_NBR,jdbcType=VARCHAR}

mapper.delete:

delete from TB_PAY_CHECK_DISREGARD
where DISREGARD_NO = #{DISREGARD_NO,jdbcType=VARCHAR}
  and CHECK_NBR = #{CHECK_NBR,jdbcType=VARCHAR}
